import React, { Component } from "react";
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import Home from "./Home";
import Australia from "./Australia";
import Turkey from "./Turkey";
import About from "./About";



class Main extends Component {
  render() {
    return (
      <HashRouter>
        <div className="home">
          <div className="navHead side">
            <div className="side_left">
              <div className="logo">
                <h2>happymovie</h2>
              </div>
            </div>
            <div className="side_right">
              <div className="navigation">
                <ul className="navigation_list">
                  <li><NavLink exact to="/">Home</NavLink></li>
                  <li><NavLink to="/australia">Australia</NavLink></li>
                  <li><NavLink to="/turkey">Turkey</NavLink></li>
                  <li><NavLink to="/about">About</NavLink></li>
                </ul>
              </div>
            </div>
          </div>
          <div className="banner">
            <div className="banner__bg"/>
            <img src={require("./assets/img/bannerfilm.jpg")} alt="" className="bannerImage"/>
          </div>
          <div className="content">
            <Route exact path="/" component={Home}/>
            <Route exact path="/australia" component={Australia}/>
            <Route exact path="/turkey" component={Turkey}/>
            <Route exact path="/about" component={About}/>
          </div>
        </div>
      </HashRouter>
    );
  }
}

export default Main;
